description:
eXtelevision covers competitive 6v6 TF2 matches, using a post-production approach to ensure that the presentation of gameplay is top notch. Commentary is in English done by eXtine of CommunityFortress and TGBF.tv

eXtv features custom uniforms and looks to push the envelope of eSports coverage. 

This torrent contains every episode of eXtelevision from its inception till 6-3-10, approximately an 8 month period. Due to the ever evolving filming techniques, early episodes are done in the .wmv format while later episodes are presented uncut in a .mp4 format. Certain .mp4s are 60FPS, which will be the standard as eXtv looks to distribute future episodes through Torrents.

